import React, { Component } from "react";

class TaskTable extends Component {

  render() {
    const { tasks } = this.props;

    return (
      <table>
        <thead>
          <tr>
            <th>#</th>
            <th>Task</th>
            <th>(x)</th>
          </tr>
        </thead>
        <tbody>
          {tasks.map((task, i) => {
            return (
              <tr>
                <td className="taskNumber">Task {i + 1}:</td>
                <td className="taskName">{task}</td>
                <td className="taskDel">
                  <button>x</button>
                </td>
              </tr>
            );
          })}
        </tbody>
      </table>
    );
  }
}

export default TaskTable;
